import React, { } from 'react';
import '../index.css';
import Navbar from './navbar';
import Footbar from './footer';
import { Card } from 'react-bootstrap';


const Home = () => {


  return (
        <><Navbar />
        <Card > 
            Hello, User!
            <center>
            <div style={{"borderStyle": "solid" , "borderColor": "#b9eeff", "width":"50%" ,"backgroundColor": "#a6b0bf", "padding":50}} className="row">
                <div class="align-middle" style={{"borderStyle": "solid" , "borderColor": "black","width": "45%"}}><span class="align-middle">Experiment</span></div>
                <div class="align-middle" style={{"borderStyle": "solid" , "borderColor": "black","width": "45%"}}><span class="align-middle">Classroom</span></div>
            </div>
            </center>
        </Card>

        <Footbar /></>
    )
};

export default Home
